import React from 'react';

// Defining a dragon
class drgn {
    constructor(name,type,habitat,trainable,atk,speed,armor,firepower,shotlimit,venom,jawstrength,stealth) {
        this.name = name;
        this.type = type;
        this.habitat = habitat;
        this.trainable = trainable;
        this.atk = atk;
        this.speed = speed;
        this.armor = armor;
        this.firepower = firepower;
        this.shotlimit = shotlimit;
        this.venom = venom;
        this.jawstrength = jawstrength;
        this.stealth = stealth;
    }
}

// Creating the HTYD dragons
const Armorwing = new drgn('Armorwing','mistery','caves',true,12,7,50,10,4,0,11,1);


export const Body = () => {
    return ( 
        <div>
            <table>
                <tr>
                    <th>Attribute</th>
                    <td>{Armorwing.name}</td>
                </tr>
                <tr>
                    <th>Name</th>
                    <td>{Armorwing.type}</td>
                </tr>
                <tr>
                    <th>Type</th>
                    <td>{Armorwing.habitat}</td>
                </tr>
                <tr>
                    <th>Habitat</th>
                    <td>{Armorwing.trainable.toString()}</td>
                </tr>
                <tr>
                    <th>Trainable</th>
                    <td>{Armorwing.atk}</td>
                </tr>
                <tr>
                    <th>Attack</th>
                    <td>{Armorwing.speed}</td>
                </tr>
                <tr>
                    <th>Speed</th>
                    <td>{Armorwing.armor}</td>
                </tr>
                <tr>
                    <th>Armor</th>
                    <td>{Armorwing.firepower}</td>
                </tr>
                <tr>
                    <th>Firepower</th>
                    <td>{Armorwing.shotlimit}</td>
                </tr>
                <tr>
                    <th>Shot Limit</th>
                    <td>{Armorwing.venom.toString()}</td>
                </tr>
                <tr>
                    <th>Venomous</th>
                    <td>{Armorwing.jawstrength}</td>
                </tr>
                <tr>
                    <th>Jaw Strength</th>
                    <td>{Armorwing.stealth.toString()}</td>
                </tr>
                <tr>
                    <th>Stealth</th>

                </tr>
            </table>
        </div>
    );
}
